import React from 'react';
import '../styles/Home.css';
import Navbar from './Navbar';
import ScrambledText from './ScrambledText';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <>
      <Navbar />
      <div className="home-container">
        {/* Hero Section */}
        <section className="hero-section">
          <div className="hero-background">
            <img 
              src="https://images.unsplash.com/photo-1542291026-7eec264c27ff?w=1200&h=600&fit=crop" 
              alt="Hero Banner" 
              className="hero-image"
            />
            <div className="overlay"></div>
          </div>

          <div className="hero-content">
            <div className="header-brand">
              <h1 className="brand-name">Dress Code</h1>
            </div>

            <div className="scrambled-container">
              <ScrambledText
                className="scrambled-text-demo"
                radius={100}
                duration={1.2}
                speed={0.5}
                scrambleChars=".:,"
              >
                Elevate Your Style. Express Your Identity. Define Your Dress Code.
              </ScrambledText>
            </div>

            <button className="shop-button" onClick={() => navigate('/products')}>
              Shop Now
            </button>
          </div>

          <div className="hero-controls">
            <div className="dot-indicators">
              <span className="dot active"></span>
              <span className="dot"></span>
            </div>
            <div className="nav-arrows">
              <button className="arrow-btn prev">❮</button>
              <button className="arrow-btn next">❯</button>
            </div>
          </div>
        </section>
      </div>
    </>
  );
}

export default Home;
